sys_variable_value.value:
(function execute(inputs, outputs) {

  var table = inputs.table;
  var query = inputs.query;
  var fields = inputs.fields.split(",");
  var orderType = inputs.order_type ? inputs.order_type : "desc"
  var sortField = inputs.sort_by;
  var recordLimit = inputs.row_limit;

  outputs.row = "";
  var newLine = String.fromCharCode(13) + String.fromCharCode(10);

  var tableGr = new GlideRecord(table);
  tableGr.addEncodedQuery(query);

  if(recordLimit)
    tableGr.setLimit(recordLimit);

  if(sortField){
    if(orderType == "desc")
      tableGr.orderByDesc(sortField);
    else
      tableGr.orderBy(sortField);
  }

  tableGr.query();

  while(tableGr.next()) {

    for(var i in fields){

      var f = fields[i];
      outputs.row += tableGr.getDisplayValue(f);

      if(i < fields.length-1)
        outputs.row += ",";
      else
        outputs.row += newLine;
    }

  }




})(inputs, outputs);

